import React, { Fragment } from 'react';
import { Routes, Route,Link  } from 'react-router-dom';
import BarChart from './components/BarChart';
import PieChart from './components/PieChart';
import PaginationTable from './components/PaginationTable'
import './App.css'
function Home() {
  return (
    <div>
      <PaginationTable/>
    </div>
  );
}



function Code() {
  return (
    <div>
      {/* Your Code component content */}
      <h2>Code Page</h2>
    </div>
  );
}

function Help() {
  return (
    <div>
      {/* Your Help component content */}
      <h2>Help Page</h2>
    </div>
  );
}

function About() {
  return (
    <div>
      {/* Your About component content */}
      <h2>About Page</h2>
    </div>
  );
}

function App() {
  return (
    <Fragment>
      <div className="navbar">
        <input type="radio" name="slider" id="home" />
        <input type="radio" name="slider" id="blog" />
        <input type="radio" name="slider" id="code" />
        <input type="radio" name="slider" id="help" />
        <input type="radio" name="slider" id="about" />
        <nav>
          <div className="slider"></div>
          <label htmlFor="home" className="home"><i className="fa fa-home"></i>Home</label>
          <Link to="/blog">
          <label htmlFor="blog" className="blog"><i className="fa fa-minus-circle"></i>Blog</label>
                  </Link>

          <label htmlFor="code" className="code"><i className="fa fa-code"></i>Code</label>
          <label htmlFor="help" className="help"><i className="fa fa-envelope"></i>Help</label>
          <label htmlFor="about" className="about"><i className="fa fa-user"></i>About</label> 
        </nav>
      </div>

      <Routes>
  <Route path="/" element={<Home />} />
  <Route path="/blog" element={<BarChart />} /> {/* Use BarChart component for the "/blog" path */}
  <Route path="/code" element={<Code />} />
  <Route path="/help" element={<Help />} />
  <Route path="/about" element={<About />} />
</Routes>
    </Fragment>
  );
}


export default App;
